            <div class="text-info-block">
                <div class="text-block">
                    <div class="expot-text">
                        Современный мировой торговый рынок развивается экспоненциально, это стимулирует Группу «RISE OIL» к развитию, и росту профессионального уровня трейдеров Компании, к глубокому изучению экспортно-импортных отношений и увеличению поставок в сфере нефтепродуктов.
                    <br><br>
                        Так, Группой «RISE OIL» в 2021 году реализация нефти и нефтепродуктов на международных рынках достиг объема более 320 000 тонн, что на 54 % выше уровня показателя объема продаж 2020 года. 
                        Этому, способствовало развитие новых рынков в направлениях стран Средней и Юго-Восточной Европы, Восточной Европы, Кавказа, Северной и Восточной Африки, где Компания «RISE OIL» осуществляет регулярные крупнооптовые поставки светлых и темных нефтепродуктов.
                    </div>
