    <div class="export-container">
        <div class="container">
            <div class="business">
                <div class="business-block">
                    <div class="business-text">
                        Подход к бизнесу
                    </div>
                </div>
            </div>
            <div class="business-text-block">
                <div class="business-info">
                    «Когда бог слепил человека из глины, у него остался один комок лишнего материала. Бог спросил человека: «Что тебе слепить из оставшейся глины?». «Счастье», – ответил человек. Тогда бог взял комок и вложил его человеку в руки.»
                </div>
                <div class="business-info-2">
                    Мир непрерывно развивается, и по нашему мнению, совсем скоро наиболее востребованными окажутся три вида Компаний, те, которые:
                    <br></br>
                    <ol class="business-info-ol">
                    <li>Владеют и умеют управлять капиталом.</li>
                    <li>Создают программируемые устройства и современные технологии.</li>
                    <li>Являются непревзойденными профессионалами в своей области.</li>
                    </ol>
                    <br>
                    Наша Концепция бизнеса направлена именно на третью группу. Нас отличает два важнейших качества: во-первых, умение в ограниченный период времени осваивать приемы и техники повышенной сложности, во-вторых — способность производить продукт высочайшего качества в кратчайшие сроки.
                    <br></br>
                    Ответственный подход к бизнесу способствует экономическому прогрессу и развитию общества в Мире. Мы нацелены на эффективные методы сотрудничества, для достижения наибольших результатов.
                    <br></br>
                    Наши Департаменты координации экспортных поставок непрерывно ведет активную работу над расширением международной географии деятельности и диверсификацией маршрутов логистики в страны дальнего и ближнего зарубежья.

                </div>
            </div>
